import React, {Component} from 'react';

class Pixel extends Component {
  render(){
    const { pixelGroup } =this.props;
    return(
      <>
      {pixelGroup.map((item, i) => {
        return(
          <td id={item[i]} className='p'>{item}</td>
          )
      })}
      </>
    )
  }
}

export default Pixel;
